import React from 'react';

const Recipes = props => (
    <div>
        { props.hits.map((oneRecipe) => {
          return (
            <div key={oneRecipe.recipe.calories}>
              <img src={oneRecipe.recipe.image} alt={oneRecipe.recipe.label}/>
              <p>{oneRecipe.recipe.label}</p>
            </div>
          );
        }) }

    </div>
);

export default Recipes;
